import styles from "./Navbar.module.css";




const Navbar = ({ isAuthenticated }) => {

    return (
        <nav className="navbar">
            <div className={ styles.container}>
                <div className={ styles.navbarRow}>
                    < NavbarNav />
                    { isAuthenticated? <UserMenu/> : <AuthNav/>}
                </div>
            </div>
        </nav>
    )
}

